ow.\\n        \",\"\\n            Best Regards,\\n            WSO2 Carbon Team\\n            http://www.wso2.com\\n        \"]',-1234),(41,'[\"WSO2 - Admin Forced Password Reset\",\"\\n            Hi {{user.claim.givenname}},\\n\\n            We received a request to change the password on the {{user-name}} account associated with this e-mail address.Please use below OTP as the password at next login and then reset your password.\\n\\n            OTP : {{confirmation-code}}\\n\\n        \",\"\\n            Best Regards,\\n            WSO2 Carbon Team\\n            http://www.wso2.com\\n        \"]',-1234),(42,'[\"WSO2 Carbon - Your account unlocked\",\"\\n            Hi {{user.claim.givenname}},\\n\\n            Please note that the account registered with us with the user name : {{user-name}} has been unlocked.\\n        \",\"\\n            Best Regards,\\n            WSO2 Identity Server Team\\n            http://www.wso2.com\\n        \"]',-1234),(43,'[\"WSO2 Carbon - Your account Locked\",\"\\n            Hi {{user.claim.givenname}},\\n\\n            Please note that the account registered with us with the user name : {{user-name}} has been locked.\\n        \",\"\\n            Best Regards,\\n            WSO2 Identity Server Team\\n            http://www.wso2.com\\n        \"]',-1234),(44,'[\"WSO2 Carbon - Your account enabled\",\"\\n            Hi {{user.claim.givenname}},\\n\\n            Please note that the account registered with us with the user name : {{user-name}} has been enabled.\\n        \",\"\\n            Best Regards,\\n            WSO2 Identity Server Team\\n            http://www.wso2.com\\n        \"]',-1234),(45,'[\"WSO2 Carbon - Your account disabled\",\"\\n            Hi {{user.claim.givenname}},\\n\\n            Please note that the account registered with us with the user name : {{user-name}} has been disabled.\\n        \",\"\\n            Best Regards,\\n            WSO2 Identity Server Team\\n            http://www.wso2.com\\n        \"]',-1234),(46,'[\"WSO2 Carbon - Your Password Reset successfully\",\"\\n            Hi {{user.claim.givenname}},\\n\\n            Please note that your password reset operation is successfully completed.\\n        \",\"\\n            Best Regards,\\n            WSO2 Identity Server Team\\n            http://www.wso2.com\\n        \"]',-1234),(47,'[\"WSO2 Carbon - You started to reset password\",\"\\n            Hi {{user.claim.givenname}},\\n\\n            This is to notify that you have initiate to reset your password using security questions.\\n        \",\"\\n            Best Regards,\\n            WSO2 Identity Server Team\\n            http://www.wso2.com\\n        \"]',-1234),(48,'[\"WSO2 Carbon - Your account is inactive\",\"\\n            Hi {{user.claim.givenname}},\\n\\n            It looks as though you haven\\u0027t signed in to your account for quite a while. Please sign in to your account if you\\u0027d like to keep your account active.\\n        \",\"\\n            Best Regards,\\n            WSO2 Identity Server Team\\n            http://www.wso2.com\\n        \"]',-1234),(49,'<Policy xmlns=\"urn:oasis:names:tc:xacml:3.0:core:schema:wd-17\" PolicyId=\"authn_time_and_role_based_policy_template\"\n        RuleCombiningAlgId=\"urn:oasis:names:tc:xacml:1.0:rule-combining-algorithm:first-applicable\" Version=\"1.0\"><Description>This policy template provides ability to authorize users to a given service provider(defined by SP_NAME) in the authentication flow based on the Roles of the user (defined by ROLE_1 and ROLE_2) and the time of the day (eg. between 09:00:00 to 17:00:00). Users who have at least one of the given roles will be able to login within the given time. Any other requests will be denied.</Description><Target><AnyOf><AllOf><Match MatchId=\"urn:oasis:names:tc:xacml:1.0:function:string-equal\"><AttributeValue DataType=\"http://www.w3.org/2001/XMLSchema#string\">SP_NAME</AttributeValue><AttributeDesignator AttributeId=\"http://wso2.org/identity/sp/sp-name\" Category=\"http://wso2.org/identity/sp\" DataType=\"http://www.w3.org/2001/XMLSchema#string\" MustBePresent=\"false\"/></Match><Match MatchId=\"urn:oasis:names:tc:xacml:1.0:function:string-equal\"><AttributeValue DataType=\"http://www.w3.org/2001/XMLSchema#string\">authenticate</AttributeValue><AttributeDesignator AttributeId=\"http://wso2.org/identity/identity-action/action-name\" Category=\"http://wso2.org/identity/identity-action\" DataType=\"http://www.w3.org/2001/XMLSchema#string\" MustBePresent=\"false\"></AttributeDesignator></Match></AllOf></AnyOf></Target><Rule Effect=\"Permit\" RuleId=\"permit_by_roles_and_time\"><Condition><Apply FunctionId=\"urn:oasis:names:tc:xacml:1.0:function:and\"><Apply FunctionId=\"urn:oasis:names:tc:xacml:2.0:function:time-in-range\"><Apply FunctionId=\"urn:oasis:names:tc:xacml:1.0:function:time-one-and-only\"><AttributeDesignator AttributeId=\"urn:oasis:names:tc:xacml:1.0:environment:current-time\" Category=\"urn:oasis:names:tc:xacml:3.0:attribute-category:environment\" DataType=\"http://www.w3.org/2001/XMLSchema#time\" MustBePresent=\"true\"></AttributeDesignator></Apply><AttributeValue DataType=\"http://www.w3.org/2001/XMLSchema#time\">09:00:00</AttributeValue><AttributeValue DataType=\"http://www.w3.org/2001/XMLSchema#time\">17:00:00</AttributeValue></Apply><Apply FunctionId=\"urn:oasis:names:tc:xacml:1.0:function:or\"><Apply FunctionId=\"urn:oasis:names:tc:xacml:1.0:function:string-is-in\"><AttributeValue DataType=\"http://www.w3.org/2001/XMLSchema#string\">ROLE_1</AttributeValue><AttributeDesignator AttributeId=\"http://wso2.org/claims/role\" Category=\"urn:oasis:names:tc:xacml:1.0:subject-category:access-subject\" DataType=\"http://www.w3.org/2001/XMLSchema#string\" MustBePresent=\"true\"/></Apply><Apply FunctionId=\"urn:oasis:names:tc:xacml:1.0:function:string-is-in\"><AttributeValue DataType=\"http://www.w3.org/2001/XMLSchema#string\">ROLE_2</AttributeValue><AttributeDesignator AttributeId=\"http://wso2.org